import React, { useEffect, useState } from 'react';
import {
    Dialog,
    DialogContent,
    DialogTitle,
    Typography,
    Chip,
} from '@mui/material';
export default function ApptDialog({ selectedStartTimes, doctorUniqId, id, dialogOpen, handleCloseDialog, selectedDate, doctorsAvailability, setSelectedStartTime, handleBooking }) {
console.log(doctorUniqId);
    const [getDoctors, setGetdoctors] = useState({})
    console.log();

    useEffect(() => {
        const AllDoctors = doctorsAvailability?.find((e) => e.doctorId === doctorUniqId)
        console.log(AllDoctors,"sirr");
        setGetdoctors(AllDoctors);

      }, []);
  
    return (
        <div>
            <Dialog open={dialogOpen} onClose={handleCloseDialog} minWidth="md" fullWidth >
                <DialogTitle style={{ fontSize: '17px', fontWeight:"550" }}>Dr.{getDoctors.doctorName}</DialogTitle>
  

                <DialogContent style={{marginTop:'-1rem'}}>
                <Typography variant="body2" > {getDoctors.specialist}</Typography>
                    <Typography variant="body2" style={{ color: "grey" }}>Selected Date: {selectedDate}</Typography>
                    <Typography variant="body2" style={{ color: "grey" }}>Available Start Times:</Typography>
                    {selectedStartTimes.map((startTime, index) => (
                        <Chip
                            key={index}
                            label={startTime}
                            variant="outlined"
                            color="primary"
                            className="mt-2"
                            onClick={() => {
                                setSelectedStartTime(startTime);
                                handleBooking(getDoctors.doctorId, id);
                            }}
                        />
                    ))}
                </DialogContent>
            </Dialog>
        </div>
    );
}
